import React from 'react';
import ReactDOM from 'react-dom';
import ShowPhotos from './components/ShowPhotos';
import CreatePhoto from './components/CreatePhoto';

function Index() {
  return (
    <div className="App">
      <ShowPhotos />
      <CreatePhoto />
    </div>
  );
}

ReactDOM.render(<Index />, document.getElementById('root'));
